import React from 'react'
import { useGlobalContext } from './Context'

function Movies() {
    const { data } = useGlobalContext()
    return (
        <>
            {data.map((val) => {
                return <div>{val.Title}</div>
            })
            }
        </>
    )
}

export default Movies;
